package com.wml.springboot.auth.entity;public class RoleResourceOperation extends BaseEntity {	private static final long serialVersionUID = 2482302361798722810L;	private Long roleId;	private String resourceId;	private String operationKey;	public Long getRoleId() {		return this.roleId;	}	public void setRoleId(Long roleId) {		this.roleId = roleId;	}	public String getResourceId() {		return this.resourceId;	}	public void setResourceId(String resourceId) {		this.resourceId = resourceId;	}	public String getOperationKey() {		return this.operationKey;	}	public void setOperationKey(String operationKey) {		this.operationKey = operationKey;	}	public String toString() {		return "RoleResourceOperation{roleId='" + this.roleId + '\''				+ ", resourceId='" + this.resourceId + '\''				+ ", operationKey='"				+ (this.operationKey == null ? "" : this.operationKey) + '\''				+ '}';	}}